import React, { Component} from "react";
import './Navbar.css'
import NavItem from '../NavItem/NavItem';
import { render } from "@testing-library/react";
import Routes from '../Routes/Routes';
import {Link} from "react-router-dom";



export default class PageArray extends Component {
    constructor(props) {
        super(props);
        this.state = {
            pageArray: [
                {
                  id: 1,
                  title: "Home",
                  nav: "/",
              },{
                id: 2,
                title: "Resume",
                nav: "/resume",
              }
            ]
        }
    };

    render() {
    return (
    <ul>{Pages}</ul>
    );
}
}

export function Pages(pages) {
    return(
<li><Link to={pages.nav}>{pages.title}</Link></li> )};
